  # Encode some text into the input units
  def encode_text(this, text,inputs,no_of_inputs,  offset, max_field_length_chars):
    pos = offset
    max_chars = len(text)

    if max_chars > (no_of_inputs-offset)/8:
      max_chars = ((no_of_inputs-offset)/8)

    if max_chars > max_field_length_chars:
      max_chars = max_field_length_chars

    # for each character in the string
    for i in range(max_chars):
      # set the bits for this character
      for bit in range(8):
        if ord(text[i]) & (1 << bit):
          inputs.append(0.75)
        else:
          inputs.append(0.25)
        pos = pos + 1

    # set the remaining inputs within the field to neutral
    i = max_chars
    while i < max_field_length_chars:
      for bit in range (8):
        if pos >= no_of_inputs:
          i = max_field_length_chars
          break
        inputs.append(0.5)
        pos = pos + 1
      i = i + 1

  def update(this, inputs):
    pos = 0
    network_inputs = []
    prev_hiddens = []
    hiddens = []
    outputs = []

    if len(inputs) < 128:
        return []

    for i in range(this.no_of_input_fields):
      if this.field_length[i] == 0:
        # Normalise numeric inputs into a 0.25 - 0.75 range
        network_inputs.append(0.25 + ((float(inputs[i]) - this.input_range_min[i])*0.5/(this.input_range_max[i] - this.input_range_min[i])))
        if network_inputs[pos] < 0.25:
          network_inputs[pos] = 0.25
        if network_inputs[pos] > 0.75:
          network_inputs[pos] = 0.75

        pos = pos + 1
      else:
        # text value
        this.encode_text(inputs[i], network_inputs, this.no_of_inputs,pos, this.field_length[i]/8)
        pos = pos + this.field_length[i]

    # Hidden layer 0
    for i in range(this.no_of_hiddens):
      adder = this.hidden_layer_0_bias[i]
      for j in range(this.no_of_inputs):
        adder = adder + this.hidden_layer_0_weights[i*this.no_of_inputs+j]*network_inputs[j]
      hiddens.append(1.0 / (1.0 + math.exp(-adder)))
    for i in range(this.no_of_hiddens):
      prev_hiddens.append(hiddens[i])

    # Hidden layer 1
    for i in range(18):
      adder = this.hidden_layer_1_bias[i]
      for j in range(25):
        adder = adder + this.hidden_layer_1_weights[i*25+j]*prev_hiddens[j]
      hiddens[i] = 1.0 / (1.0 + math.exp(-adder))
    for i in range(18):
      prev_hiddens[i] = hiddens[i]

    # Hidden layer 2
    for i in range(10):
      adder = this.hidden_layer_2_bias[i]
      for j in range(18):
        adder = adder + this.hidden_layer_2_weights[i*18+j]*prev_hiddens[j]
      hiddens[i] = 1.0 / (1.0 + math.exp(-adder))
    for i in range(10):
      prev_hiddens[i] = hiddens[i]

    # Output layer
    for i in range(this.no_of_outputs):
      adder = this.output_layer_bias[i]
      for j in range(10):
        adder = adder + this.output_layer_weights[i*10+j]*prev_hiddens[j]
      outputs.append(1.0 / (1.0 + math.exp(-adder)))

    # Convert outputs from 0.25 - 0.75 back to their original range
    for i in range(this.no_of_outputs):
      outputs[i] = this.output_range_min[i] + ((outputs[i]-0.25)*(this.output_range_max[i] - this.output_range_min[i])/0.5)

    # Return the output unit values as a list
    return outputs


